const MuiBottomNavigation = () => { 
  const  [bnValue, setBNValue] = useState(0);
  return (
    <BottomNavigation
      sx={{ width: "100%", position: "fixed", bottom: 0 }}
      value={bnValue}
      onChange={(event, value) => 
        setBNValue(value)}
      >

      <BottomNavigationAction  label="Profile" icon={<PersonIcon />} value={bnValue} to="/Profile" />
      <BottomNavigationAction  label="Home" icon={<HomeIcon />} value={bnValue} to="../index" />
      <BottomNavigationAction  label="Add" icon={<AddIcon />} value={bnValue} to="/Add" />

    </BottomNavigation>
  );

};
